import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Apply price range filter
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.fill('#minPrice', '100'); // Set minimum price
    await page.waitForSelector('#maxPrice', { timeout: 5000 });
    await page.fill('#maxPrice', '500'); // Set maximum price
    await page.waitForSelector('.apply-filter', { timeout: 5000 });
    await page.click('.apply-filter'); // Click on apply filter button

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filter_applied.png'));

    // Verify if the filter is applied by checking for products in the price range
    const products = await page.$$('.product-card');
    const filteredPrices = await Promise.all(products.map(async (product) => {
      const priceText = await product.$eval('.product-price', el => el.innerText.replace('$', ''));
      return parseFloat(priceText);
    }));

    const isFilterApplied = filteredPrices.every(price => price >= 100 && price <= 500);

    return {
      success: true,
      action: "Applied price range filter and verified products",
      extractedData: { isFilterApplied },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
